import React from 'react';
export default function Projects() {
  return (
    <section className="p-8 text-white">
      <h2 className="text-3xl font-bold mb-4">Projects</h2>
      <ul className="list-disc list-inside">
        <li><a href="https://github.com/Devb1234/Power-BI-Projects/tree/main/HR%20Analytics" className="underline">HR Analytics Dashboard</a></li>
        <li><a href="https://github.com/Devb1234/Power-BI-Projects/tree/main/Madhav%20Store%20Ecommerce%20Data" className="underline">Ecommerce Data Analysis</a></li>
        <li><a href="https://github.com/Devb1234/Power-BI-Projects/tree/main/Super%20Store%20Sales%20Data" className="underline">Super Store Sales Insights</a></li>
      </ul>
    </section>
  );
}
